import React from "react";
import "./Skills.css";

const Skills = () => {
    return (
        <div class="skills">
    <h2>Skills</h2>
    <div className="skills-content">
        <div className="skill"><img src="./img/python.png" alt="Resim Açıklaması" /><span>Python</span></div>
        <div className="skill"><img src="./img/react.png" alt="Resim Açıklaması" /><span>React</span></div>
        <div className="skill"><img src="./img/sql.png" alt="Resim Açıklaması" /><span>SQL</span></div>
        <div className="skill"><img src="./img/machine-learning.png" alt="Resim Açıklaması" /><span>Machine Learning</span></div>
        <div className="skill"><img src="./img/deep-learning.png" alt="Resim Açıklaması" /><span>Deep Learning</span></div>
        <div className="skill"><img src="./img/java.png" alt="Resim Açıklaması" /><span>JAVA</span></div>
        <div className="skill"><img src="./img/js.png" alt="Resim Açıklaması" /><span>JavaScript</span></div>
    </div>
</div>
    )
}
export default Skills
